    return (
        <>
        <p>Kurssin nimi: {props.course}</p>
        </>
    )
}

const Content = (props) => {
    return (
        <>
        <p>{props.part}, tehtäviä: {props.exercises}</p>
        </>
    )


}

const Total = (props) => {
    return (
        <>
        <p>Tänne tulee yhteislukumäärä</p>
        </>
    )
}

